INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (100101, "獣人族", "東山奈央", "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", 0, 27, 44, "A", 2, 155, 16, "ヒヨリ", "人助けが大好き！　前向き格闘娘", "人助け、応援", 8, "トゥインクルウィッシュ");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (100201, "ヒューマン", "種田梨沙", "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", 0, 5, 47, "O", 2, 158, 17, "ユイ", "戦闘のサポートが得意な、心優しい少女", "料理、人間観察", 4, "トゥインクルウィッシュ");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (100301, "魔族", "早見沙織", "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", 0, 12, 46, "B", 2, 163, 18, "レイ", "クールで何事にも真っ直ぐな剣士", "読書、乗馬、お茶", 1, "トゥインクルウィッシュ");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (100401, "ヒューマン", "諸星すみれ", "イタズラなら任せて！\nにいちゃん、引っかからないように気を付けなよー♪", 0, 10, 27, "O", 5, 128, 9, "ミソギ", "探検好きのイタズラっ子", "いたずら、探検", 8, "リトルリリカル");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (100501, "獣人族", "下田麻美", "？？？", 0, 25, 40, "O", 8, 146, 12, "マツリ", "ヒーローに憧れる騎士見習いの少女", "ヒーローごっこ", 11, "王宮騎士団（NIGHTMARE）");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (100601, "魔族", "浅倉杏美", "アカリ、まだわからないことが多くて…\nだからこれから\nいろいろ教えてくださいね、お兄ちゃん！", 0, 22, 42, "O", 7, 150, 13, "アカリ", "甘え上手なみんなの人気者", "サックス", 11, "悪魔偽王国軍（ディアボロス）");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (100701, "魔族", "雨宮天", "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", 0, 23, 32, "B", 7, 130, 14, "ミヤコ", "プリン大好きゴースト娘", "プリンを食べること", 1, "悪魔偽王国軍（ディアボロス）");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (100801, "エルフ", "大空直美", "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", 0, 10, 40, "AB", 15, 150, 14, "ユキ", "ボクは誰よりも美しい", "鏡で自分を見ること", 10, "ヴァイスフリューゲル　ランドソル支部");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (100901, "魔族", "髙野麻美", "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", 0, 5, 45, "A", 13, 159, 17, "アンナ", "前世を信じる中二病患者、「疾風の冥姫」", "小説執筆", 7, "トワイライトキャラバン");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (101001, "獣人族", "内田真礼", "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", 0, 22, 42, "O", 10, 155, 16, "マホ", "マホマホ王国のプリンセス", "空想、ぬいぐるみ集め", 9, "自警団（カォン）");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (101101, "ヒューマン", "阿澄佳奈", "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？", 0, 25, 44, "A", 3, 156, 15, "リノ", "人懐っこくてマシンガントークな妹系少女", "お裁縫", 8, "ラビリンス");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (101201, "エルフ", "大橋彩香", "私はハツネ！　困っている人の味方だよ！\n困った時は、いつでも言ってね♪\n私のちょ…ま、魔法で助けてあげるから！", 0, 24, 46, "A", 6, 156, 17, "ハツネ", "みんなのために超能力を使う眠り姫", "妹と遊ぶこと、二度寝、昼寝、早寝", 12, "フォレスティエ");
