INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (101501, "エルフ", "國府田マリ子", "test", 0, 5, 54, "O", 6, 165, 21, "ミサト", "母性溢れる優しいみんなの「ミサト先生」", "絵本作り", 9, "フォレスティエ");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (101601, "魔族", "上坂すみれ", "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！", 0, 10, 48, "O", 14, 167, 18, "スズナ", "天真爛漫で人気者のカリスマモデル", "ファッション", 4, "ルーセント学院");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (101701, "獣人族", "高森奈津美", "ハイターイ！　歌って踊って、\n最高に盛り上がるさ～！\nやさやさ、キミも一緒に踊るさ～！", 0, 7, 53, "A", 10, 158, 19, "カオリ", "いつでも「なんくるないさ～」な天然娘", "踊り、空手", 7, "自警団（カォン）");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (101801, "魔族", "伊藤静", "いつも助けてくれてありがとう\n私のほうが年上なのに\n頼ってばかりでごめんなさい～", 0, 14, 52, "B", 14, 162, 23, "イオ", "多くの男性を魅了する無垢な女教師", "恋愛小説、恋愛舞台、恋愛漫画の鑑賞", 8, "ルーセント学院");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (102001, "獣人族", "日高里菜", "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！", 0, 3, 21, "O", 5, 117, 10, "ミミ", "お歌もにんじんも、ウサギさんも大好き♪", "かわいいもの集め", 4, "リトルリリカル");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (102101, "ヒューマン", "植田佳奈", "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", 0, 9, 40, "B", 9, 150, 12, "クルミ", "泣き虫で臆病な守ってあげたい女の子", "観劇、おままごと", 6, "サレンディア救護院");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (102201, "魔族", "原紗友里", "え、えっと…こ、こういうときって、\nどういうことを言えばいいんだっけ…\nうう、どうしてちゃんと喋れないの…", 0, 22, 40, "O", 7, 150, 13, "ヨリ", "人見知りであまのじゃくな女の子", "ゲーム全般", 11, "悪魔偽王国軍（ディアボロス）");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (102301, "ヒューマン", "芹澤優", "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", 0, 10, 38, "B", 9, 148, 14, "アヤネ", "ぷうきちといつも一緒！", "屋内でできる遊び", 5, "サレンディア救護院");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (102501, "ヒューマン", "悠木碧", "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", 0, 12, 43, "O", 9, 154, 15, "スズメ", "お嬢さまのためにがんばるドジっ娘メイド", "ご奉仕", 12, "サレンディア救護院");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (102601, "獣人族", "小岩井ことり", "test", 0, 1, 42, "B", 11, 144, 17, "リン", "遊びと睡眠が何より大事なぐうたら娘", "あんパン", 1, "牧場（エリザベスパーク）");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (102701, "魔族", "橋本ちなみ", "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", 0, 30, 43, "B", 13, 154, 16, "エリコ", "運命の相手に一途すぎる乙女", "実験、裁縫、料理", 7, "トワイライトキャラバン");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (102801, "エルフ", "堀江由衣", "貧乏性？　いいえ、\n「もったいない」の精神で\n日々を過ごしてるだけよ！", 0, 4, 43, "A", 9, 156, 17, "サレン", "救護院を経営する優しい庶民派お嬢様", "経営、お茶会", 10, "サレンディア救護院");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (102901, "ヒューマン", "日笠陽子", "いつか世界中の人達をファンにしてみせる！\nトップアイドルになるその日まで、\n応援よろしくね♪", 0, 24, 40, "B", 4, 157, 17, "ノゾミ", "歌って踊れる大人気アイドル", "舞台鑑賞、ダンス", 1, "カルミナ");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (103001, "ヒューマン", "佐藤聡美", "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", 0, 31, 51, "O", 15, 163, 16, "ニノン", "トーゴクの神秘、オシエテクダサイ！", "忍法開発", 8, "ヴァイスフリューゲル　ランドソル支部");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (103101, "魔族", "大坪由佳", "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", 0, 22, 42, "AB", 7, 157, 18, "シノブ", "占いが得意な霊能少女", "占い", 12, "悪魔偽王国軍（ディアボロス）");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (103201, "ヒューマン", "松嵜麗", "この私とともにいる限り、\nお金に不自由はさせませんわ！", 0, 12, 45, "AB", 12, 157, 18, "アキノ", "一人前の商人を目指すパワフルお嬢様", "慈善事業", 3, "メルクリウス財団");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (103301, "ヒューマン", "新田恵海", "オラはどんな時でもみんなに笑顔を届ける\n最高の芸人目指してる！\n一緒に頑張るべ！", 0, 3, 35, "B", 11, 142, 20, "マヒル", "みんなを笑顔にするお笑い牧場主", "漫才", 3, "牧場（エリザベスパーク）");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (103401, "エルフ", "今井麻美", "キミには情けないところばかり\n見られているけど、こんなところ、\nキミ以外には見せないんだからね？", 0, 16, 55, "A", 12, 164, 22, "ユカリ", "純情でほっとけない大人の女性", "ウインドーショッピング", 3, "メルクリウス財団");
