INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (103701, "ヒューマン", "茅原実里", "test", 0, 11, 43, "A", 8, 149, 13, "トモ", "義理堅くてからかい好きな剣術少女", "剣術、年長者をからかう", 8, "王宮騎士団（NIGHTMARE）");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (103801, "獣人族", "小清水亜美", "ゴホッ、ゴホッ…か、身体は弱いけど、\nせめて気持ちだけでも前向きに…！\nあっ、でもダメ…立ちくらみが…", 0, 3, 40, "A", 11, 153, 14, "シオリ", "読書が趣味の病弱少女", "読書、お散歩", 11, "牧場（エリザベスパーク）");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (104001, "エルフ", "花澤香菜", "友達ができるその日まで…\nBB団で\nトレーニングですっ！", 0, 6, 44, "AB", 6, 158, 13, "アオイ", "「友達」に憧れる、エルフの森の女の子", "友達作りのイメトレ", 6, "フォレスティエ");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (104201, "ヒューマン", "福原綾香", "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", 0, 3, 46, "O", 4, 163, 17, "チカ", "人々を守るために歌う、唱喚士の少女", "各種楽器", 6, "カルミナ");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (104301, "獣人族", "小松未可子", "腹へってたら言えよな\n簡単でよければ\nすっげー旨いもん食わせてやるよ！", 0, 9, 54, "O", 10, 168, 17, "マコト", "男勝りで情に厚いワイルド娘", "お菓子作り", 8, "自警団（カォン）");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (104401, "魔族", "丹下桜", "test", 0, 5, 50, "A", 7, 172, "??", "イリヤ", "かつては夜を支配した最強の吸血鬼", "世界征服", 5, "悪魔偽王国軍（ディアボロス）");
