INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (104601, "獣人族", "沼倉愛美", "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", 0, 1, 48, "AB", 12, 158, 18, "タマキ", "弱きを助け強きをくじく猫娘", "猫とたわむれること", 3, "メルクリウス財団");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (104701, "ヒューマン", "川澄綾子", "？？？", 0, 25, 50, "A", 8, 171, 25, "ジュン", "素顔を見せない冷静沈着な女性騎士", "格闘技、湯浴み", 10, "王宮騎士団（NIGHTMARE）");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (104801, "ヒューマン", "田所あずさ", "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", 0, 11, 49, "O", 12, 163, 20, "ミフユ", "仕事も私事も効率優先な傭兵少女", "傭兵などのアルバイト", 11, "メルクリウス財団");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (104901, "ヒューマン", "生天目仁美", "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", 0, 24, 54, "O", 3, 168, 18, "シズル", "お姉ちゃんがお世話してあげるからねっ！", "家事全般", 10, "ラビリンス");
