INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (107901, "獣人族", "沼倉愛美", "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", 0, 1, 48, "AB", 12, 158, 18, "タマキ（サマー）", "弱きを助け強きをくじく猫娘", "猫とたわむれること", 3, "メルクリウス財団");
