INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (108101, "魔族", "大坪由佳", "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", 0, 22, 42, "AB", 7, 157, 18, "シノブ（ハロウィン）", "占いが得意な霊能少女", "占い", 12, "悪魔偽王国軍（ディアボロス）");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (108201, "魔族", "雨宮天", "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", 0, 23, 32, "B", 7, 130, 14, "ミヤコ（ハロウィン）", "プリン大好きゴースト娘", "プリンを食べること", 1, "悪魔偽王国軍（ディアボロス）");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (108301, "魔族", "久野美咲", "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", 0, 3, 22, "A", 14, 120, 11, "ミサキ（ハロウィン）", "ちょっとおませな恋に恋する女の子", "ファッション誌鑑賞、コスメ集め", 1, "ルーセント学院");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (108401, "ヒューマン", "福原綾香", "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", 0, 3, 46, "O", 4, 163, 17, "チカ（クリスマス）", "人々を守るために歌う、唱喚士の少女", "各種楽器", 6, "カルミナ");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (108501, "ヒューマン", "植田佳奈", "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", 0, 9, 40, "B", 9, 150, 12, "クルミ（クリスマス）", "泣き虫で臆病な守ってあげたい女の子", "観劇、おままごと", 6, "サレンディア救護院");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (108601, "ヒューマン", "芹澤優", "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", 0, 10, 38, "B", 9, 148, 14, "アヤネ（クリスマス）", "ぷうきちといつも一緒！", "屋内でできる遊び", 5, "サレンディア救護院");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (108701, "獣人族", "東山奈央", "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", 0, 27, 44, "A", 2, 155, 16, "ヒヨリ（ニューイヤー）", "人助けが大好き！　前向き格闘娘", "人助け、応援", 8, "トゥインクルウィッシュ");
